import React from "react"
import { Container } from "reactstrap"
import logo from "../../assets/images/res-logo.png"
import { NavLink, Link } from "react-router-dom"
const nav__links = [
  {
    display: "Home",
    path: "/home"
  },
  {
    display: "All-Foods",
    path: "/foods"
  },
  {
    display: "Cart",
    path: "/cart"
  },
  {
    display: "Contact",
    path: "/contact"
  }
]
const Header = () => {
  return (
    <header>
      <Container>
        <div className='nav__wrapper'>
          <div className='logo'>
            <img src={logo} alt='' />
            <h5>Restaurant</h5>
          </div>
          {/* =========menu ======= */}
          <div className='navigation'>
            <div className='menu'>
                {nav__links.map((item,index)=>(
                    <NavLink/>
                ))}
            </div>
          </div>
        </div>
      </Container>
    </header>
  )
}

export default Header
